if (request_vendor_parameters && request_vendor_parameters.page) {
	let page = request_vendor_parameters.page;	//payments uses offset (0 based)
	//the vault api uses page starts with 1 (\_()_/) so we need to doubly increment
	let map = {
		'page': parseInt(page) + 1
	};
	done({
		"request_vendor_parameters": map
	});
}

done();

if (typeof request_vendor_body_map === 'undefined') {
 // In order to pass vendor specific request, user has to pass request body in array 
    //if not defined, then it's an array and that's what paypal wants
    done();
} else {
 		var data = request_vendor_body_map;
    var arrayBody = [];
    var ROOT = "/";
    var SLASH = "/"

    Object.keys(data).forEach(function(key) {
        var path = ROOT + key;
        var type = identifyType(data[key]);
        if (type === "Primitive") {
            handlePrimitive(path, data[key]);
        } else if (type === "Object") {
            handleObject(path, data[key]);
        } else if (type === "Array") {
            handleArray(path, data[key]);
        }
    });

    function handlePrimitive(path, value) {
        var temp = {};
        var operation;
        if (value) {
            operation = "replace";
            temp.value = value;
        } else {
            operation = "remove";
        }
        temp.op = operation;
        temp.path = path;
        arrayBody.push(temp);
    }

    /*
     * This method iterates array and generates operations like `/transactions/0/amount`
     */
    function handleArray(path, values) {
        var index = 0;
        values.forEach(function(value) {
            var innerPath = path + SLASH + index;
            handleObject(innerPath, value);
            index++;
        });
    }

    /*
     * This method iterates individual keys of an object and handle separately based on type of it's value
     */
    function handleObject(path, value) {
        Object.keys(value).forEach(function(key) {
            var innerPath = path + SLASH + key;
            var type = identifyType(value[key]);
            if (type === 'Primitive') {
                handlePrimitive(innerPath, value[key]);
            } else if (type === 'Object') {
                handleObject(innerPath, value[key]);
            } else if (type === 'Array') {
                handleArray(innerPath, value[key]);
            }
        });
    }

    function identifyType(obj) {
        if (!obj) {
            return "Primitive";
        }
        switch (obj.constructor) {
            case Array:
                return "Array";
            case Object:
                return "Object";
            default:
                return "Primitive";
        }
    }
    done({
        "request_vendor_body": arrayBody
    });
}

let configs = configuration;
let map = {};
let path = configs['oauth.authorization.url'];

if (request_parameters['paypalv2.sandbox'] === 'true') {
    path = path.replace("https://www.paypal.com", "https://www.sandbox.paypal.com");
}
path += "?response_type=code";
path += "&client_id=";
// if we're provisioning from Catalog, then we have a API key/sec like {liveKey}, {sandboxKey}
if (request_parameters['client_id'].indexOf(", ") > -1) {
	if (request_parameters['paypalv2.sandbox'] === 'true') {
		path += request_parameters['client_id'].substring(request_parameters['client_id'].indexOf(", ") + 2, request_parameters['client_id'].length);	
	} else {
		path += request_parameters['client_id'].substring(0, request_parameters['client_id'].indexOf(", "));
	}
} else {
	path += request_parameters['client_id'];
}
if (configs['oauth.scope']) {
	path += "&scope=" + encodeURIComponent(configs['oauth.scope']);	
}
if (configs['state']) {
	path += "&state=" + configs['state'];	
} else {
	path += "&state=paypalv2";	
}

path += "&redirect_uri=" + encodeURIComponent(request_parameters['redirect_uri']);

done({
	"request_vendor_path": path,
	"configuration": map
});

let refreshTime = Date.now();
let map = {};
map['oauth.user.refresh_time'] = refreshTime.toString();

let key = request_parameters['client_id'];
let secret = request_parameters['client_secret'];
// if we're provisioning from Catalog, then we have a API key/sec like {liveKey}, {sandboxKey}
if (key && key.indexOf(", ") > -1) {
	if (configuration['paypalv2.sandbox'] === 'true') {
		map['oauth.api.key'] = key.substring(key.indexOf(", ") + 2, key.length);
		map['oauth.api.secret'] = secret.substring(secret.indexOf(", ") + 2, secret.length);	
	} else {
		map['oauth.api.key'] = key.substring(0, key.indexOf(", "));
		map['oauth.api.secret'] = secret.substring(0, secret.indexOf(", "));
	}
}

if (configuration['paypalv2.sandbox'] === 'true') {
    map['oauth.authorization.url'] = configuration['oauth.authorization.url'].replace("https://www.paypal.com", "https://www.sandbox.paypal.com");
   	map['oauth.token.url'] = configuration['oauth.token.url'].replace("https://api.paypal.com", "https://api.sandbox.paypal.com");
	map['oauth.token.refresh_url'] = configuration['oauth.token.refresh_url'].replace("https://api.paypal.com", "https://api.sandbox.paypal.com");
	map['base.url'] = configuration['base.url'].replace("https://api.paypal.com", "https://api.sandbox.paypal.com");
}

done({
	"configuration": map
